import React from "react";
import './Form.css'

function Form(props) {

    const toggleForm = event => {
        props.setActiveForm(props.form)
        console.log('active: ' + props.activeForm.id);
        console.log('this :' + props.form.id);
    }

    return ( 
        <div className="form">
            <button id={props.form.key} onClick={toggleForm} >{props.form.title}</button>
            <br/>
            {props.activeForm===props.form ? props.form.content : ''}
            
        </div>
     );
}

export default Form;
